import React, { useState } from 'react';

const Payment = () => {
  const [amount, setAmount] = useState('');
  const [currency, setCurrency] = useState('USD');
  const [beneficiary, setBeneficiary] = useState('');
  const [description, setDescription] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validate amount
    if (isNaN(amount) || amount <= 0) {
      alert('Please enter a valid amount');
      return;
    }

    // Validate beneficiary
    if (beneficiary.trim() === '') {
      alert('Please enter a beneficiary name');
      return;
    }

    // Simulating form submission
    console.log('Payment Details:', {
      amount: parseFloat(amount).toFixed(2),
      currency,
      beneficiary,
      description,
    });

    // Redirect to transaction pending page (you can modify this URL)
    alert('Redirecting to payment processing...');
    // window.location.href = '/transaction-pending'; // Uncomment this if needed
  };

  // Format amount input to always show 2 decimal places
  const handleAmountBlur = (e) => {
    if (e.target.value) {
      setAmount(parseFloat(e.target.value).toFixed(2));
    }
  };

  return (
    <div className="bg-gray-50 min-h-screen flex items-center justify-center p-4">
      <div className="bg-white rounded-lg shadow-xl p-8 max-w-md w-full">
        <h1 className="text-2xl font-bold text-gray-900 mb-6">Payment Details</h1>
        
        <form onSubmit={handleSubmit} className="space-y-6">
          <div className="flex space-x-4">
            <div className="input-group flex-grow">
              <label htmlFor="amount" className="block text-sm font-medium text-gray-700 mb-1">Amount</label>
              <div className="relative">
                <input 
                  type="number" 
                  id="amount" 
                  name="amount"
                  value={amount}
                  onChange={(e) => setAmount(e.target.value)}
                  onBlur={handleAmountBlur}
                  className="mt-1 block w-full px-3 py-2 bg-white border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-purple-500"
                  required 
                  step="0.01" 
                  min="0.01"
                />
              </div>
            </div>
            
            <div className="input-group w-1/3">
              <label htmlFor="currency" className="block text-sm font-medium text-gray-700 mb-1">Currency</label>
              <select 
                id="currency" 
                name="currency"
                value={currency}
                onChange={(e) => setCurrency(e.target.value)}
                className="custom-select mt-1 block w-full px-3 py-2 bg-white border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-purple-500"
              >
                <option value="USD">USD</option>
                <option value="EUR">EUR</option>
                <option value="GBP">GBP</option>
                <option value="JPY">JPY</option>
                <option value="AUD">AUD</option>
                <option value="CAD">CAD</option>
              </select>
            </div>
          </div>

          <div className="input-group">
            <label htmlFor="beneficiary" className="block text-sm font-medium text-gray-700 mb-1">Beneficiary Name</label>
            <input 
              type="text" 
              id="beneficiary" 
              name="beneficiary"
              value={beneficiary}
              onChange={(e) => setBeneficiary(e.target.value)}
              className="mt-1 block w-full px-3 py-2 bg-white border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-purple-500"
              required
            />
          </div>

          <div className="input-group">
            <label htmlFor="description" className="block text-sm font-medium text-gray-700 mb-1">Payment Description (Optional)</label>
            <textarea 
              id="description" 
              name="description"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              rows="2"
              className="mt-1 block w-full px-3 py-2 bg-white border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-purple-500 focus:border-purple-500"
            />
          </div>

          <button 
            type="submit" 
            className="w-full bg-purple-600 text-white px-4 py-3 rounded-md hover:bg-purple-700 focus:outline-none focus:ring-2 focus:ring-purple-500 focus:ring-offset-2 transition-colors"
          >
            Proceed to Payment
          </button>
        </form>
      </div>
    </div>
  );
};

export default Payment;
